  false,\n\t\"url\": null,\n\t\"notes\": \"During the spring of 2004, landbird breeding
  surveys were conducted at Honeypot Road, Westfield (20.62 acres) of the Silvio O.
  Conte National Fish and Wildlife Refuge. The survey's purpose was to document the
  occurrence, distribution, and abundance of landbird species. Results will provide
  a baseline for future monitoring of bird populations. U. S. Fish and Wildlife Services
  provided funding for this survey.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
